-- Création de la structure de la table 'villes'


CREATE TABLE IF NOT EXISTS `villes` (
	`ville_id`	INTEGER NOT NULL,
	`ville_departement`	VARCHAR ( 3 ) DEFAULT NULL,
	`ville_nom`	VARCHAR ( 45 ) DEFAULT NULL,
	`ville_code`	INTEGER NOT NULL UNIQUE,
	`ville_population`	INTEGER DEFAULT NULL,
	`ville_densite`	INTEGER DEFAULT NULL,
	`ville_surface`	REAL DEFAULT NULL,
	`ville_alt_min`	INTEGER DEFAULT NULL,
	`ville_alt_max`	INTEGER DEFAULT NULL,
	PRIMARY KEY(`ville_id`)
);

-- Insertion des données dans la table 'villes'
COMMIT;
